  namespace: System.Collections.Generic
  summary: "\n<p>Represents a collection of objects that can be individually accessed by index.</p>\n"
  remarks: "\n<p>The <xref href=\"System.Collections.Generic.IList`1\" data-throw-if-not-resolved=\"false\"></xref> generic interface is a descendant of the <xref href=\"System.Collections.Generic.ICollection`1\" data-throw-if-not-resolved=\"false\"></xref> generic interface and is the base interface of all generic lists.</p>\n"
  syntax:
    content: >-
      [TypeDependency("System.SZArrayHelper")]

      public interface IList<T> : ICollection<T>, IEnumerable<T>, IEnumerable
    content.vb: >-
      <TypeDependency("System.SZArrayHelper")>

      Public Interface IList(Of T)
          Inherits ICollection(Of T)
