  namespace: System.Collections.Generic
  summary: "\n<p>Inserts an item to the <xref href=\"System.Collections.Generic.IList`1\" data-throw-if-not-resolved=\"false\"></xref> at the specified index.</p>\n"
  remarks: "\n<p>If <em>index</em> equals the number of items in the <xref href=\"System.Collections.Generic.IList`1\" data-throw-if-not-resolved=\"false\"></xref>, then <em>item</em> is appended to the list.</p>\n<p>In collections of contiguous elements, such as lists, the elements that follow the insertion point move down to accommodate the new element. If the collection is indexed, the indexes of the elements that are moved are also updated. This behavior does not apply to collections where elements are conceptually grouped into buckets, such as a hash table.</p>\n"
  syntax:
    content: void Insert(int index, T item)
    content.vb: Sub Insert(index As Integer, item As T)
    parameters:
    - id: index
      type: System.Int32
    - id: item
      type: '{T}'
